import React from 'react';
import { useDroppable, useDraggable } from '@dnd-kit/core';

const Droppable = ({ items }) => {
  const { setNodeRef } = useDroppable({
    id: "droppable"
  });

  return (
    <ul ref={setNodeRef} className='flex border-b bg-white h-14 my-3 pt-1'>
      {items.map((item, idx) => (
        <li key={`${item}-${idx}`} className='py-3 px-5 mb-1 me-1 font-semibold bg-white rounded-lg border border-gray-300 font-mono'>
          <Draggable key={item} id={item} data={{ title: item }}>
            {({ attributes, listeners, transform }) => (
              <button {...attributes} {...listeners} style={transform ? { transform: `translate3d(${transform.x}px, ${transform.y}px, 0)` } : undefined}>
                {item}
              </button>
            )}
          </Draggable>
        </li>
      ))}
    </ul>
  );
};

export default Droppable;
